import React from 'react';

const Portfolioitem = props => {
	console.log(props);

	const styles = {
		backgroundImage: props.backgroundImageURL
	};
	return (
		<div className="portfolio-item" style={styles}>
			{props.name}
			{props.backgroundImageURL}
			{props.link}
			{props.id}
		</div>
	);
};

export default Portfolioitem;
